# capture username only IN=$1 IFS=':' read -ra OUT <<< "$IN" USERNAME=${OUT[0]}
# we now substitue hamid with user name so we can actually see our links on pinboard.in sed -i '' -e "s/u:hamid/u:$USERNAME/" info.plist
# set the auth token in config.json if ! ./alfred-pinboard-rs config --authorization $IN; then echo "Couldn't set user credentials!!!" else echo "Successfully set user credentials." fi
